import React, { Component } from "react";
import TestThumbnail from "./TestThumbnail";

export default class RankingSidebar extends Component {
  render() {
    return (
      <div class="ranking-sidebar ">
        <RankingTable className="top-view-container" title="Top Luot Xem" />
        <RankingTable className="top-favorite-container" title="Top Theo Doi" />

        <div className="top-favorite-container"></div>
      </div>
    );
  }
}

function RankingTable(props) {
  return (
    <div className={props.className} class="border" style={{ma}}>
      <div
        className="title text-start d-flex align-items-center"
        style={{
          fontWeight: "bold",
          fontSize: "larger",
          color: "var(--red-lipstick)",
        }}
      >
        <span class="material-symbols-outlined">visibility</span>
        <span class="ms-2">Top Luot Xem</span>
      </div>
      <div className="content">
        <RankingItem></RankingItem>
        <RankingItem></RankingItem>
        <RankingItem></RankingItem>
      </div>
    </div>
  );
}

function RankingItem(props) {
  return (
    <li class="border-bottom p-2 mb-2">
      <div class="row">
        <div class="col-1 d-flex align-items-center text-center">
          <div class="roster">01</div>
        </div>
        <div class="col-11">
          <div class="row">
            <div class="thumbnail col-3">
              <TestThumbnail width="60px" height="60px" fit="cover" />
            </div>
            <div class="col-9 position-relative">
              <div
                className="manga-title"
                class="text-start"
                style={{ fontWeight: "bolder" }}
              >
                vo luyen dinh phong
              </div>
              <div
                className="chapter-ranking-number position-absolute bottom-0 text-start"
                style={{ width: "100%" }}
              >
                <div class="row">
                  <div class="col">Chapter 167</div>
                  <div
                    class="col d-flex align-items-center"
                    style={{ color: "gray" }}
                  >
                    <span class="material-symbols-outlined">visibility</span>
                    <span class="ms-2">10M</span>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </li>
  );
}
